       }

     ]
     };
  render() {

    return (
    <>
<table class="table table-striped"style={{ border: "1px solid black"}}>
  <thead>
    <tr>
      <th scope="col">Number</th>
      <th scope="col">reservation</th>
      <th scope="col">color</th>
    </tr>
  </thead>

  {this.state.user.map(elem=> (<Row  user={elem} Add={this.props.Add}/>)     ) }
</table>

   </>   
    ); 
  }

}

